import React from "react";
//import { BrowserRouter, Route, Link } from "react-router-dom";

function Sidebar() {
    return (
        <div class="container-fluid" id="main">
            <div class="row row-offcanvas row-offcanvas-left vh-100">
                <div class="col-md-3 col-lg-2 sidebar-offcanvas h-100 overflow-auto bg-light pl-0" id="sidebar" role="navigation">
                    <ul class="nav flex-column sticky-top pl-0 pt-5 mt-3">
                    <li class="nav-item"><a class="nav-link" href="/home">Tickets</a></li>
                    <li class="nav-item">
                        <a class="nav-link" href="#submenu1" data-toggle="collapse" data-target="#submenu1">Dashboard</a>
                        <ul class="list-unstyled flex-column pl-3 collapse" id="submenu1" aria-expanded="false">
                            <li class="nav-item"><a class="nav-link" href="/home">Option 1</a></li>
                            <li class="nav-item"><a class="nav-link" href="/home">Option 2</a></li>
                        </ul>
                    </li>
                    <li class="nav-item"><a class="nav-link" href="/home">Assets</a></li>
                    <li class="nav-item"><a class="nav-link" href="/home">Software License</a></li>
                    <li class="nav-item"><a class="nav-link" href="/home">Hardware</a></li>
                    <li class="nav-item"><a class="nav-link" href="/home">Lab Equipments</a></li>
                    <li class="nav-item"><a class="nav-link" href="/home">Electronics</a></li>
                    <li class="nav-item"><a class="nav-link" href="/home">Tools</a></li>
            </ul>
                </div>
            </div>
        </div>
    );
}

export default Sidebar;
